# Load required libraries
library(leaflet)
library(shiny)
library(shinyjs)

ui <- fluidPage(
  # Enable JavaScript interactivity
  useShinyjs(),
  # Meta and styles/scripts
  tags$head(
    # Responsive design
    tags$meta(
      name = "viewport",
      content = "width=device-width, initial-scale=1"
    ),
    # tags$script(
    #   '
    #     Shiny.addCustomMessageHandler("checkMobile", function(message) {
    #     var isMobile = /iPhone|iPad|iPod|Android/i.test(navigator.userAgent);
    #     Shiny.setInputValue("is_mobile", isMobile);
    #     });
    #     '
    # ),
    # Custom styles
    tags$link(rel = "stylesheet", type = "text/css", href = "styles.css"),
  ),
  # Detect if device is mobile, and store it in input$is_mobile
  tags$script(HTML(
    "
      Shiny.addCustomMessageHandler('checkMobile', function(message) {
        var isMobile = /iPhone|iPad|iPod|Android/i.test(navigator.userAgent);
        Shiny.setInputValue('is_mobile', isMobile, {priority: 'event'});
      });
      $(document).on('shiny:sessioninitialized', function() {
        Shiny.setInputValue('is_mobile', /iPhone|iPad|iPod|Android/i.test(navigator.userAgent), {priority: 'event'});
      });
    "
  )),
  # App title
  titlePanel("BiblioStatus - Which Finnish Libraries Are Open Right Now?"),

  # Layout: Sidebar + Main panel
  sidebarLayout(
    sidebarPanel(
      class = "sidebar-panel",
      selectInput(
        inputId = "city_filter",
        label = "Select City/Municipality:",
        choices = NULL
      ),
      checkboxInput(
        inputId = "dark_mode",
        label = span("Dark mode", class = "dark-mode-label"),
        value = FALSE
      ),
      br(),
      # Shows details of selected library (desktop only)
      uiOutput("library_services")
    ),
    mainPanel(
      div(
        id = "loading-spinner",
        "Loading data, please wait...",
        class = "loading-text"
      ),
      leafletOutput("map", height = "85vh")
    )
  )
)

# Connect to SQLite
db_path <- here("libraries.sqlite")

# Uncomment for the local version
# db_path <- here("app/libraries.sqlite")

# Function to fetch libraries from SQLite
fetch_libraries <- function() {
  # fmt: skip
  con <- dbConnect(SQLite(), dbname = db_path, read_only = TRUE)
  libraries <- dbReadTable(con, "libraries")
  dbDisconnect(con)

  return(libraries)
}

# Function to fetch schedules from SQLite and determine the current open status
fetch_schedules <- function() {
  # fmt: skip
  con <- dbConnect(SQLite(), dbname = db_path, read_only = TRUE)
  schedules <- dbReadTable(con, "schedules")
  dbDisconnect(con)

  return(schedules)
}

/* Import Gotham font */
@import url("https://fonts.cdnfonts.com/css/gotham-6");

/* Responsive map height on mobile devices */
@media (max-width: 768px) {
  #map {
    height: 600px !important;
  }
}

/* Global styles */
body {
  font-family: "Gotham", sans-serif;
  background-color: #191414;
  color: #FFFFFF;
}

/* Main page title styling */
h2, .h2 {
  font-family: "Gotham", sans-serif;
  color: #d94248;
  font-size: 36px;
  text-align: center;
}

/* Dropdown label styling (city selector, etc.) */
.control-label {
  color: #d94248;       /* red label */
  font-weight: bold;
}

/* Input field focus styling */
.form-control:focus {
  border-color: #d94248;
  outline: 0;
  box-shadow: 0 0 8px #d94248;
}

/* Sidebar panel container style */
.sidebar {
  background-color: #1a1a1a;
  border-radius: 5px;
  padding: 15px;
}

/* Highlighted sidebar titles and labels (in red) */
.sidebar-panel h4,
.sidebar-panel b {
  color: #d94248;
}

/* General sidebar text styling (non-titles) */
.sidebar-panel p,
.sidebar-panel span,
.sidebar-panel div {
  color: #000000;
}

/* Loading spinner text style */
.loading-text {
  text-align: center;
  font-size: 20px;
  padding: 20px;
  color: #FFFFFF;
}

/* Dark mode switch label styling */
.dark-mode-label {
  color: #d94248;
  font-weight: bold;
}

/* Leaflet map popup text styling */
.leaflet-popup-content {
  font-size: 14px;
  color: #000; /* black popup text */
}

/* Hyperlink styling */
a {
  color: #1DB954;
  text-decoration: underline;
}

a:hover,
a:focus {
  color: #168d40;
  text-decoration: none;
}
